import React from 'react'
import "./Home.css";
import {Container } from 'react-bootstrap';
import logosolaris from './logo.jpg';

const Home = props => (
    <Container className="headercontent">
        <img src={logosolaris} alt="Logo Solaris" className="eafit" />
    </Container>
)

export default Home
